import { Route, Routes } from "react-router-dom"
import Nav from "./components/Nav/Nav";
import Home from "./components/Home/Home";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Nav />} />

        <Route path="/home" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
